import React from "react";

const TopNav =() =>
{
    let students = [
        'Shanjai',
        'Gokul',
        'Rithik',
        'Theju',
        'Srinath'
    ]

    const add =(a,b) => a + b;

    return <div> <ol>
         {students.map(students => {
            return <li>{students}</li>
         })}
    </ol>
         <p>Sum : {add(1,3)}</p>
    </div>
}


export default TopNav;
